import React from "react";

import { Container } from "./styles";

interface InputProps {
  type: string;
  placeholder: string;
}
const Input: React.FC<InputProps> = ({ type, placeholder }) => (
  <Container>
    <input type={type} placeholder={placeholder} />
  </Container>
);

export default Input;
